// LikedPostFeed.js
import React, { useEffect, useState } from "react";
import { getLikedPosts } from "../api/apiCalls";
import PostView from "./PostView";
import Spinner from "../components/Spinner";
import { useParams } from "react-router-dom";

const LikedPostFeed = ({ username }) => {
  const [likedPosts, setLikedPosts] = useState([]);

  useEffect(() => {
    const loadLikedPosts = async () => {
      try {
        const response = await getLikedPosts(username);
        setLikedPosts(response.data);
      } catch (error) {
        console.error("Error loading liked posts:", error);
      }
    };
    loadLikedPosts();
  }, [username]);
  const handleDeletePost = (postId) => {
    setLikedPosts((prevLikedPosts) => prevLikedPosts.filter((post) => post.id !== postId));
  };
  return (
    <div>
      {likedPosts.map((post) => (
        <div key={post.id} className="mb-">
          <PostView post={post}  onDeletePost={handleDeletePost}></PostView>
        </div>
      ))}
    </div>
  );
};

export default LikedPostFeed;
